const NONE = 0;
const PLAYER = 1;
const BLOCK = 2;
const TRAMPOLINE = 3;
const DEATH = 4;
const UNSTICKABLE = 5;
const RESPAWN_R = 6;
const RESPAWN_L = 7;
const GOAL = 8;

// const unitSideLength = 40;
const unitSideLength = 10;

let worldHeight = unitSideLength * map.length;
const worldHeightMin = 500;
while (worldHeight < worldHeightMin) {
    map.unshift(Array(map[0].length).fill(0));
    worldHeight = unitSideLength * map.length;
}

const entityList = [];
let playerCode = "";

const rowMax = map.length;
const colMax = map[0].length;
let respawnId = 1;

for (let row = 0; row < rowMax; row++) {
    for (let col = 0; col < colMax; col++) {
        const x = unitSideLength * col;
        const y = unitSideLength * row;

        const type = map[row][col];

        if (type === PLAYER) {
            if (playerCode === "") {
                playerCode =  "const respawnArea = this.#findRespawnArea(entityList, respawnId);\n";
                playerCode += `player = new Player(${x}, ${y}, respawnArea);`;
            }
            continue;
        }
        else if (type === NONE) {
            continue;
        }

        let width = unitSideLength;
        let nextCol = col + 1;
        while (nextCol < colMax) {
            if (map[row][nextCol] !== type) {
                break;
            }
            map[row][nextCol] = NONE;
            width += unitSideLength;
            nextCol++;
        }

        let height = unitSideLength;
        let nextRow = row + 1;
        while (nextRow < rowMax) {
            let shouldBreak = false;
            for (let c = col; c < nextCol; c++) {
                if (map[nextRow][c] !== type) {
                    shouldBreak = true;
                    break;
                }
            }
            if (shouldBreak) {
                break;
            }
            for (let c = col; c < nextCol; c++) {
                map[nextRow][c] = NONE;
            }
            height += unitSideLength;
            nextRow++;
        }

        if (type === RESPAWN_L) {
            entityList.push(`bp(new RespawnArea(${x}, ${y}, ${width}, ${height}, "left", ${respawnId++}));`);
            continue;
        }
        else if (type === RESPAWN_R) {
            entityList.push(`bp(new RespawnArea(${x}, ${y}, ${width}, ${height}, "right", ${respawnId++}));`);
            continue;
        }

        let className = "";
        switch (type) {
            case BLOCK: className = "Block"; break;
            case TRAMPOLINE: className = "Trampoline"; break;
            case DEATH: className = "DeathBlock"; break;
            case UNSTICKABLE: className = "UnstickableBlock"; break;
            case GOAL: className = "GoalArea"; break;
        }
        entityList.push(`bp(new ${className}(${x}, ${y}, ${width}, ${height}));`);
    }
}

let result = `worldHeight = ${worldHeight};\n`;

for (const code of entityList) {
    result += code + "\n";
}

result += playerCode + "\nbreak;\n";

console.log(result);
